  \"2015-12-20T18:45:37.807803\",\n\t\"name\": \"oceanographic-profile-data-collected-from-ctd-casts-aboard-bay-hydro-ii-as-part-of-project-s-e9\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0138645 includes physical
  and profile data collected aboard the Bay Hydro II during project S-E914-BH2-15
  in the Patapsco River (Baltimore MD) from 2015-03-31 to 2015-04-02. These data include
  CONDUCTIVITY, HYDROSTATIC PRESSURE, SALINITY, SOUND VELOCITY, WATER DENSITY and
  WATER TEMPERATURE. The instruments used to collect these data include CTD. These
  data were collected and submitted by the NOAA Office of Coast Survey in support
  of hydrographic multibeam surveys to meet NOAA charting requirements.\",\n\t\"license_title\":
